import React from "react";

function OfficeAddIn() {
    return <div className="bottomObj" style={{ marginRight: "10px" }}>

        <div className="hovering" style={{ marginRight: "5px", display: "inline-flex" }}>
            <img src="images/office_icon.png" style={{ marginTop: "12px", marginRight: "6px" }} />
            <p>Office Add-ins</p>
        </div>
        <div className="vl"></div>
    </div>;
}

export default OfficeAddIn;
